import { Component } from '@angular/core';
import { LoginForm } from './login';

@Component({
  selector: 'app-t-login',
  templateUrl: './t-login.component.html',
  styleUrls: ['./t-login.component.css']
})
export class TLoginComponent {
  loginFm:LoginForm;
  constructor(){
    this.loginFm = new LoginForm('aaa@aa.com', 'test');
  }
}
<div style="align-items: center;">
    <form novalidate #loginForm ngForm="loginForm">
        <!-- Email input -->
        <div class="form-outline mb-4">
            <label class="form-label" for="form2Example1">Email address</label>
          <input type="text" name="email" [(ngModel)]="loginFm.email" id="form2Example1" class="form-control" />

        </div>

        <!-- Password input -->
        <div class="form-outline mb-4">
            <label class="form-label" for="form2Example2">Password</label>
          <input type="password" name="password" [(ngModel)]="loginFm.password" id="form2Example2" class="form-control" required />

        </div>


        <!-- Submit button -->
        <button type="submit" class="btn btn-primary btn-block mb-4">Sign in</button>

      </form>
</div>
